import { Bot } from "../model/bot";
import { responseHandler } from "../response/response-handler";

export const greeting = async (req, res) => {
  try {
    const response = "HI how can i help you?";
  } catch (error) {
    console.log(error);
    return responseHandler(res, 500, error.message, false);
  }
};

